import React from 'react';
import Topbar from '../components/Topbar';
import { Box, Typography, Paper, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Clientes() {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem('neofi_auth');
    navigate('/');
  };
  return (
    <Box>
      <Topbar />
      <Box sx={{ p: 4 }}>
        <Box sx={{ display: 'flex', justifyContent: 'flex-end', mb: 2 }}>
          <Button variant="contained" color="error" onClick={handleLogout}>Sair</Button>
        </Box>
        <Typography variant="h4" color="primary" gutterBottom>Lista de Clientes</Typography>
        <Box sx={{ mb: 2, textAlign: 'right' }}>
          <TextField label="Buscar por CPF/CNPJ" size="small" sx={{ width: 220 }} />
        </Box>
        <TableContainer component={Paper} sx={{ mb: 3 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Nome</TableCell>
                <TableCell>CPF/CNPJ</TableCell>
                <TableCell>Telefone</TableCell>
                <TableCell>Email</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Data de Entrada</TableCell>
                <TableCell>Última Mov.</TableCell>
                <TableCell>Ver Operação</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {/* Conteúdo dinâmico */}
            </TableBody>
          </Table>
        </TableContainer>
        <Button variant="contained" color="primary">Adicionar Novo Cliente</Button>
      </Box>
    </Box>
  );
}

export default Clientes;
